   deployment_id INT PRIMARY KEY,
   personnel_id INT,
   incident_id INT,
   deployment_time TIMESTAMP
);

CREATE TABLE emergency_incidents (
   incident_id INT PRIMARY KEY,
   incident_name VARCHAR(50),
   incident_location VARCHAR(100),
   incident_date DATE
);

CREATE TABLE deployment_logs (
    deployment_id INT PRIMARY KEY,
    incident_id INT,
    personnel_id INT,
    deployment_time TIMESTAMP
);

CREATE TABLE personnel (
    personnel_id INT PRIMARY KEY,
    personnel_name VARCHAR(255),
    personnel_rank VARCHAR(50),
    personnel_department VARCHAR(50)
);

CREATE TABLE personnel ( 
    personnel_id INT PRIMARY KEY, 
    personnel_name VARCHAR(50), 
    incident_id INT, 
    deployment_date DATE 
);

CREATE TABLE incidents ( 
    incident_id INT PRIMARY KEY, 
    incident_name VARCHAR(50), 
    location VARCHAR(100), 
    incident_date DATE 
);

CREATE TABLE deployments ( 
    deployment_id INT PRIMARY KEY, 
    personnel_id INT, 
    incident_id INT, 
    deployment_status VARCHAR(20) 
);

CREATE TABLE deployment_log ( 
    log_id INT PRIMARY KEY, 
    deployment_id INT, 
    log_timestamp TIMESTAMP, 
    log_description TEXT 
);

CREATE TABLE Personnel (
    personnel_id INT PRIMARY KEY,
    personnel_name VARCHAR(50) NOT NULL,
    incident_id INT,
    deployment_date DATE
);

CREATE TABLE EmergencyIncidents (
    incident_id INT PRIMARY KEY,
    incident_type VARCHAR(50) NOT NULL,
    incident_date DATE,
    incident_location VARCHAR(100)
);

CREATE TABLE PersonnelRoles (
    role_id INT PRIMARY KEY,
    role_name VARCHAR(50) NOT NULL
);

CREATE TABLE IncidentCategories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(50) NOT NULL
);
